class UndergroundSystem:

    def __init__(self):
        self.checkin = {}
        self.checkout = {}

    def checkIn(self, id: int, stationName: str, t: int) -> None:
        self.checkin[id] = [stationName, t]

    def checkOut(self, id: int, stationName: str, t: int) -> None:
        [checkInStation, checkInTime] = self.checkin.pop(id)
        if checkInStation not in self.checkout:
            self.checkout[checkInStation] = []
        self.checkout[checkInStation].append([stationName, t, checkInTime])

    def getAverageTime(self, start: str, end: str) -> float:
        total = 0
        count = 0
        for [endStation, time, checkInTime] in self.checkout.get(end, []):
            if endStation == start:
                total += time - checkInTime
                count += 1
        return total / count
